import 'bootstrap/dist/css/bootstrap.css';
// Put any other imports below so that CSS from your
// components takes precedence over default styles.
import Link from "next/link";
import Resume from "../components/index/resume";

const Index = () => {
    return (
        <div className="container">
            <h1 className="typing-animation-text">
            Hi! I'm Kevin Tsai. Welcome to my website!</h1>
            <section className="about-me">
                <h2>About me</h2>
                <p>Hi! I'm Kevin Tsai. Your friendly front-end engineer and web developer. I enjoy building content on the web and solving problems via code. Check out my portfolio for a list of mini projects that I have worked on.</p>
            </section>
            <section className="education">
                <h2>Education</h2>
                <ul>
                    <li className="degree">M.S. Statistics <span className="school">San Jose State University</span></li>
                    <li className="degree">B.S. Statistics <span className="school">University of California, Davis</span></li>
                </ul>
            </section>            
            <section className="contact-info">
                <h2>Contact info</h2>
                <ul>
                    <li><a href="">linkedin profile</a></li>
                    <li>gmail</li>
                </ul>
            </section>
            <section className="portfolio-list">
                <h2>Portfolio</h2>
                <ul>
                    <li><Link href="/connect4"><a>Connect 4</a></Link></li>
                    <li><Link href="/form"><a>A Beautiful Form</a></Link></li>
                    <li><Link href="/"><a>Some Other Project</a></Link></li>
                </ul>
            </section>
        </div>
    );
};

export default Index;
